import React, {Component} from 'react';
import User from './User';


class Users extends Component {
	state = {
		users : [
			{name: "John", age : 12},
			{name: "Abhi", age : 13}
		],
		title : "User List"
	};

	makeStateChange = () => {
		this.setState ({
			users : [
				{name: "John", age : 22},
				{name: "Abhi", age : 23}
			],
		})
	}
  render() {
    return (
    	<div>
	        <button onClick={this.makeStateChange}>Make me Younger </button>

	        <User age={this.state.user[0].age}>{this.state.user[0].name}</User>
	        <User age={this.state.user[1].age}>{this.state.user[1].name}</User>
	        <User age={this.state.user[2].age}>{this.state.user[2].name}</User>
      </div>
    )
  }
}

export default Users;
